[{"location":"","page":"Home","title":"Home","text":"CurrentModule = AIS","category":"page"},{"location":"#AIS","page":"Home","title":"AIS","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for AIS.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [AIS]","category":"page"},{"location":"#AIS.ConvexPolygon","page":"Home","title":"AIS.ConvexPolygon","text":"ConvexPolygon is a convex polygon on planar and geographic coordinate system. ConvexPolygon.gvertex is vertexes of the convex polygon on the geographic coordinate system.  ConvexPolygon.pvertex is vertexes of the convex polygon on the planar coordinate system.\n\nstruct ConvexPolygon\n    gvertex::Vector{Geometry}\n    pvertex::Vector{Planar}\nend\n\nConvexPolygon(G::Vector{Geometry}) = ConvexPolygon(G,Planar.(G))\n\n\n\n\n\n","category":"type"},{"location":"#AIS.Geometry","page":"Home","title":"AIS.Geometry","text":"Geometry is a coordinate on the geographic coordinate system.\n\nstruct Geometry\n    longitude::Real\n    latitude::Real\nend\n\n\n\n\n\n","category":"type"},{"location":"#AIS.Planar","page":"Home","title":"AIS.Planar","text":"Planar is a coordinate on the planar projection of Geometry with ContactPoint as a point of contanct. In a Planar Coordinate System, the units are meters.\n\nstruct Planar\n    x::Real\n    y::Real\nend\n\n\n\n\n\n","category":"type"},{"location":"#AIS.Planar-Tuple{Geometry}","page":"Home","title":"AIS.Planar","text":"Planar(G::Geometry;ContactPoint::Geometry=DefaultRefPoint)\n\nReturn a Planar coordinate Planar(x,y) on the planar projection of G with ContactPoint as a point of contact. By default, TokyoBayRefPoint is a DefaultRefPoint.\n\n\n\n\n\n","category":"method"},{"location":"#AIS.Ship","page":"Home","title":"AIS.Ship","text":"Ship is a ConvexPolygon that have a center point on planar and geographic coordinate system. Ship.Shape is the shape of the ship. It's like a home base.  Ship.Geometry is a center point on geographic coordinate system. Ship.Planar is a center point on planar coordinate system.\n\nstruct Ship\n    Shape::ConvexPolygon\n    Geometry::Geometry\n    Planar::Planar\nend\n\nTrueHeading specifies the direction of the bow. RefPoint specifies the shape of the ship.  RefPoint is given in the form 'a-b-c-d' and 'a' is the length of the upper side from the anntena. 'b' is the lower size, 'c' is the left side and 'd' is the right side. edge_param specifies the sharpness of the bow of the ship. Ship(P::Planar,TrueHeading,RefPoint;edge_param=0.9)`\n\n\n\n\n\n","category":"type"},{"location":"#AIS.CrossProduct-Tuple{Geometry, Geometry, Geometry}","page":"Home","title":"AIS.CrossProduct","text":"CrossProduct(A::Geometry,B::Geometry,C::Geometry)\n\nGet a cross product of B-A and C-A.\n\n\n\n\n\n","category":"method"},{"location":"#AIS.CrossProduct-Tuple{Planar, Planar, Planar}","page":"Home","title":"AIS.CrossProduct","text":"CrossProduct(A::Planar,B::Planar,C::Planar)\n\nGet a cross product of B-A and C-A.\n\n\n\n\n\n","category":"method"},{"location":"#AIS.InOutJudge-Tuple{ConvexPolygon, Geometry}","page":"Home","title":"AIS.InOutJudge","text":"InOutJudge(A::ConvexPolygon,x::Geometry)\n\nReturn true if x is in A.\n\n\n\n\n\n","category":"method"},{"location":"#AIS.InOutJudge-Tuple{ConvexPolygon, Planar}","page":"Home","title":"AIS.InOutJudge","text":"InOutJudge(A::ConvexPolygon,x::Planar)\n\nReturn true if x is in A.\n\n\n\n\n\n","category":"method"},{"location":"#AIS.dist-Tuple{Planar, Planar}","page":"Home","title":"AIS.dist","text":"dist(A::Planar,B::Planar)\n\nGet the Euclid distance of A and B. \n\ndist(A::Planar) = dist(A,Planar(0.0,0.0))\n\ndist(P::Vector{Planar})\n\nGet the Euclid distance matrix of each element of P\n\n\n\n\n\n","category":"method"},{"location":"#AIS.execute-Tuple{Any, Any}","page":"Home","title":"AIS.execute","text":"execute(path)\n\nReturn the result of SQL file path execution. \n\n\n\n\n\n","category":"method"},{"location":"#AIS.mean-Tuple{Vector{Planar}}","page":"Home","title":"AIS.mean","text":"mean(P::Vector{Planar})\n\nGet a mean vector of P.\n\n\n\n\n\n","category":"method"},{"location":"#AIS.rotate-Tuple{Planar, Real}","page":"Home","title":"AIS.rotate","text":"rotate(A::Planar,θ::Real)\n\nGet a Planar rotated A θ counterclockwise\n\n\n\n\n\n","category":"method"},{"location":"#Base.:+-Tuple{Planar, Planar}","page":"Home","title":"Base.:+","text":"Base.:+(A::Planar,B::Planar)\n\nGet a composite vector of positional vectors A and B.\n\n\n\n\n\n","category":"method"},{"location":"#Base.:--Tuple{Planar, Planar}","page":"Home","title":"Base.:-","text":"Base.:-(A::Planar,B::Planar)\n\nGet a composite vector of positional vectors A and -B.\n\n\n\n\n\n","category":"method"},{"location":"#Base.cos-Tuple{Planar, Planar}","page":"Home","title":"Base.cos","text":"Base.cos(A::Planar,B::Planar)\n\nGet a cosine of the angle between vectors A and B.\n\n\n\n\n\n","category":"method"},{"location":"#Base.maximum-Tuple{Vector{Planar}}","page":"Home","title":"Base.maximum","text":"Base.maximum(A::Vector{Planar};dist=dist)\n\nReturn the element of A with the maximum distance from the origin Planar(0.0,0.0). By default, the distance is Euclid distance.\n\n\n\n\n\n","category":"method"},{"location":"#Base.minimum-Tuple{Vector{Planar}}","page":"Home","title":"Base.minimum","text":"Base.minimum(A::Vector{Planar};dist=dist)\n\nReturn the element of A with the minimum distance from the origin Planar(0.0,0.0). By default, the distance is Euclid distance.\n\n\n\n\n\n","category":"method"}]
